import React from "react";
import "./CssStyle.css";

const CssStyle = () => {
  return (
    <>
      <h1>Netflix App</h1>
      <p className="my">List of Netflix WebSeries</p>
      <ol>
        <li>Money Heist</li>
        <li>Dark</li>
        <li>Kantara</li>
        <li>Kgf 2</li>
        <li>Hum Tum</li>
      </ol>
    </>
  );
};

export default CssStyle;
